import Nav from './Nav'
import '../css/main.css'
import '../css/reset.css'
import Footer from './Footer'

const Layout = (props) => {
    return (
        <div className="pagec-ontainer">
            <Nav/>
            <div className="content-wrap">
                {props.children}
            </div>
            <Footer/>
        </div>
    )
}

export default Layout;
